I have also tried:

\begin{code}
with open('questions.txt') as f:
    for line in f:
        if re.search(r'Q:', line):
            print(line.split('Q:')[1])
\end{code}

But this prints the date and the question.

I want to print the question and the date.

Answer: You can use `re.findall` to get the question and the date:

\begin{code}
import re

with open('questions.txt') as f:
    for line in f:
        if re.search(r'Q:', line):
            print(re.findall(r'Q: (\d{4}-\d{2}-\d{2})', line))
