import re

def get_year(song):
    year = re.search(r'(?<=year)\d{4}', song)
    if year:
        return year.group()
    else:
        return None

def get_artist(song):
    artist = re.search(r'(?<=artist)\w+', song)
    if artist:
        return artist.group()
    else:
        return None

def get_song(song):
    song = re.search(r'(?<=song)\w+', song)
    if song:
        return song.group()
    else:
        return None

def get_genre(song):
    genre = re.search(r'(?<=genre)\w+', song)
    if genre:
        return genre.group()
    else:
        return None

def get_album(song):
    album = re.search(r'(?<=album)\w+', song)
    if album:
        return album.group()
    else:
        return None

def get_year_artist_song_genre_album(song):
    year = get_year(song)
    artist = get_artist(song)
    song = get_song(song)
    genre = get_genre(song)
    album = get_album(song)
    return (year, artist, song, genre, album)

